function random(min, max) {
    return toFixed(Math.random() * (max - min) + min, 2);
}

function toFixed(value, precision) {
    let num = Number(value);

    if(isNaN(num)) {
        throw 'Not a valid number';
    }

    if(!(precision >= 0 && precision <= 20)) {
        throw 'Invalid precision. Should be 0 to 20 (inclusive).';
    }

    return Number(num.toFixed(precision));
}

function dateOnly(dt) {
    if(!!dt && dt.constructor.name === 'Date') {
        return `${dt.getDate()}/${dt.getMonth()}/${dt.getFullYear()}`;
    }
}

for(let i = 0; i < 10; i++) {
    let av = 0;
    let mx = 0;
    let mn = 0;
    let data = [];
    let dt = new Date();
    let result = {};

    for(let j = 0; j < 10; j++) {
        data.push(random(50, 250));
    }

    mx = data.reduce((prev, curr) => {
        return prev > curr ? prev : curr;
    });

    mn = data.reduce((prev, curr) => {
        return prev < curr ? prev : curr;
    });

    av = data.reduce((prev, curr) => {
        return prev + curr;
    }) / data.length;

    dt.setDate(i + 1);
    
    result['Date'] = dateOnly(dt);
    result['Max'] = mx;
    result['Min'] = mn;
    result['Avg'] = toFixed(av, 2);
    
    output.push(result);
}

